import React from 'react';

export default function Alerts({ events = [], removeAlertByTs, symbol, monitorMinutes, monitorEma1, monitorEma2, validateSymbolOnce, connect, disconnect, status, connected }) {
  // Only show primary alert events (bull/bear). Hide telegram_send / telegram status events
  const visible = (events || []).filter((ev) => {
    try {
      if (!ev || !ev.type) return false;
      const t = (ev.type || '').toString();
      // hide auxiliary telegram events
      if (t.startsWith('telegram')) return false;
      // show only bull/bear or similar alert types
      return t === 'bull' || t === 'bear' || t === 'alert';
    } catch (e) {
      return false;
    }
  });

  // Always render the alerts section (even if no visible alerts) so Start/Stop can be used
  return (
    <div className="alerts">
      <div className="alerts-title">Alerts</div>

      <div className="alerts-controls" style={{display: 'flex', gap: 8, alignItems: 'center', marginBottom: 8}}>
        <div style={{display: 'flex', gap: 8, alignItems: 'center'}}>
          <div className="label-text">Symbol</div>
          <div style={{fontWeight:700}}>{(symbol || '').toString().toUpperCase()}</div>
        </div>
        <div style={{display: 'flex', gap: 8, alignItems: 'center'}}>
          <div className="label-text">Mins</div>
          <div>{monitorMinutes}</div>
        </div>
        <div style={{display: 'flex', gap: 8, alignItems: 'center'}}>
          <div className="label-text">EMA1</div>
          <div>{monitorEma1}</div>
        </div>
        <div style={{display: 'flex', gap: 8, alignItems: 'center'}}>
          <div className="label-text">EMA2</div>
          <div>{monitorEma2}</div>
        </div>

        <div style={{marginLeft: 'auto', display: 'flex', gap: 8}}>
          <button disabled={status === 'reloading' || !(symbol)} onClick={async () => {
            try {
              const ok = await (validateSymbolOnce ? validateSymbolOnce(symbol) : Promise.resolve(true));
              if (!ok) return;
              try { connect && connect(symbol, { interval: monitorMinutes, emaShort: monitorEma1, emaLong: monitorEma2 }); } catch (e) { try { connect && connect(symbol); } catch (err) {} }
            } catch (e) {}
          }}>Start</button>

          <button className="secondary" onClick={() => { try { disconnect && disconnect(); } catch (e) {} }}>Stop</button>
        </div>
      </div>

      <ul className="alerts-list">
        {visible.map((ev, i) => (
          <li key={ev?.ts ?? i} className="alert-item">
            <div className="alert-left">
              <span className={`alert-indicator ${ev.type === 'bull' ? 'bull' : 'bear'}`} />
              <div className="alert-symbol">{ev.symbol || ''}</div>
            </div>

            <div className="alert-body">
              <div className="alert-info">
                <div className="alert-type-short">{ev.type === 'bull' ? 'Bull' : 'Bear'}</div>
                <div className="alert-time">{ev.time}</div>
              </div>
              <div className="alert-right">
                <div className="alert-price">{typeof ev.price === 'number' ? ev.price : ev.price}</div>
                <div style={{fontSize:'0.7rem', color:'#666', marginTop:4}}>{ev.source || ''}</div>
                <button className="delete-btn" onClick={() => removeAlertByTs(ev.ts)} aria-label="삭제" title="삭제">✕</button>
              </div>
            </div>
          </li>
        ))}
      </ul>
    </div>
  );
}
